import './TodoItem.css'

function TodoItem(props) {
    return (
      <li>
        <span 
          className={`material-symbols-outlined check-item .icon-check ${props.completed && "icon-check--active"} `
        }
        onclick={setTodos}>
        check
        </span>
        <p>{props.text}</p>
        <span className="material-symbols-outlined close-item .icon-closed">
        delete
        </span>
      </li>
    );
  }

  export {TodoItem};
